    Joint Venture (PPJV) area.  increase recruitment of ducks in the Prairie Pothole
    Joint Venture (PPJV) area. These guidelines are a result of numerous meetings involving
    research and management personnel from a variety of Federal, State, and private
    organizations. The objective of these guidelines is to bring into use as much scientific
